*
 * 打开客户端 带tab按钮的二级网页新页面，例如分类
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {Object} params - 调用客户端桥所需要的参数
 * @param {Array} params.tabs - [{webTitle, webUrl}]
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('open-app-tab-web-page', {
 *   params: {
 *     tabs: [{
 *       webTitle: '测试1',
 *     }, {
 *       webTitle: '测试2',
 *     }, {
 *       webTitle: '测试3',
 *     }],
 *   },
 * }).then((info) => {
 *   console.log(`[open-app-tab-web-page][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[open-app-tab-web-page][error] ${JSON.stringify(err, null, 2)}`);
 * });
 *

